import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import * as d3 from 'd3'
import csv from './Resources/data.csv';

import Chart from "./Components/Chart"

class App extends Component {
  constructor(props){
    super(props)

    this.state = {

    }
  }
  componentWillMount(){
    let curr = this;
    d3.dsv(',', csv, function(d) {
        return {
            year: d['year'],
            location: d.location_name,
            sex_name: d.sex_name,
            val: +d.val 
          };
    }).then(function(data){
        const d = data;
        curr.setState({'data':d})
    });
  }

  render() {
    return (
      <div className="App">
        <Chart data={this.state.data}/>
      </div>
    );
  }
}

export default App;
